  true,\n\t\"url\": null,\n\t\"notes\": \"SSA initiated this agreement with the Department
  of Defense (DOD) to transmit to SSA information that will identify military personnel
  injured or taken ill while in support of Operations Enduring Freedom and Iraqi Freedom
  before an SSA application is filed.  When an SSN is requested, the response will
  include an indication that the SSN belongs to an individual that the DOD has idenfied
  as a Military Casualty.  the following alert will then be generated: \"Military
  Casualty Alert - Use Expedited Procedures\".  Expedited services will then be provided
  to these military personnel.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
